import { Component } from "react";
import Header from "./conponents/Header/Header.jsx";
import Nav from "./conponents/Nav/Nav.jsx";
import DialogF from "./conponents/Dialogs/Message/DialogF.jsx";
import Setting from "./conponents/Setting/Setting.jsx";
import Music from "./conponents/Music/Music.jsx";
import "./App.css";
import { Route } from "react-router-dom";
import UsersC from "./conponents/New/NewC";
import ProfileC from "./conponents/Profile/ProfileC";

export default class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Nav />
        <Route path="/dialog" render={() => <DialogF />} />
        <Route path="/profile/:userid" render={() => <ProfileC />} />
        <Route path="/new" render={() => <UsersC />} />
        <Route path="/setting" render={() => <Setting />} />
        <Route path="/music" render={() => <Music />} />
      </div>
    );
  }
}
